contracts/QuiFlixContent.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title QuiFlixContent
 * @dev Content Contract for managing film payments and royalties
 */
contract QuiFlixContent is Ownable, ReentrancyGuard, Pausable {
    using Counters for Counters.Counter;

    Counters.Counter private _contentIdCounter;

    // Struct to store content information
    struct Content {
        uint256 contentId;
        string title;
        string ipfsHash;
        address producer;
        uint256 totalRevenue;
        uint256 totalViews;
        bool isActive;
        uint256 createdAt;
    }

    // Struct for payment splits
    struct PaymentSplit {
        address producer;
        uint256 producerPercentage; // in basis points (10000 = 100%)
        address platform;
        uint256 platformPercentage; // in basis points
    }

    // Mapping from content ID to content
    mapping(uint256 => Content) public contents;

    // Mapping from producer to their content
    mapping(address => uint256[]) public producerContent;

    // Payment split configuration
    PaymentSplit public paymentSplit;

    // Events
    event ContentCreated(uint256 indexed contentId, address indexed producer, string title, string ipfsHash);
    event RevenueDistributed(uint256 indexed contentId, address indexed producer, uint256 producerAmount, uint256 platformAmount);
    event ViewRecorded(uint256 indexed contentId, address indexed viewer);
    event PaymentSplitUpdated(uint256 producerPercentage, uint256 platformPercentage);

    constructor(
        address _producer,
        uint256 _producerPercentage,
        address _platform,
        uint256 _platformPercentage
    ) {
        require(_producer != address(0), "Invalid producer address");
        require(_platform != address(0), "Invalid platform address");
        require(_producerPercentage + _platformPercentage == 10000, "Percentages must sum to 100%");

        paymentSplit = PaymentSplit({
            producer: _producer,
            producerPercentage: _producerPercentage,
            platform: _platform,
            platformPercentage: _platformPercentage
        });
    }

    /**
     * @dev Create new content
     * @param _title Content title
     * @param _ipfsHash IPFS hash of the content
     */
    function createContent(
        string memory _title,
        string memory _ipfsHash
    ) external whenNotPaused returns (uint256) {
        uint256 contentId = _contentIdCounter.current();
        _contentIdCounter.increment();

        contents[contentId] = Content({
            contentId: contentId,
            title: _title,
            ipfsHash: _ipfsHash,
            producer: msg.sender,
            totalRevenue: 0,
            totalViews: 0,
            isActive: true,
            createdAt: block.timestamp
        });

        producerContent[msg.sender].push(contentId);

        emit ContentCreated(contentId, msg.sender, _title, _ipfsHash);

        return contentId;
    }

    /**
     * @dev Record a view for content
     * @param _contentId Content ID
     */
    function recordView(uint256 _contentId) external {
        require(_contentId < _contentIdCounter.current(), "Content does not exist");
        require(contents[_contentId].isActive, "Content is not active");

        contents[_contentId].totalViews++;

        emit ViewRecorded(_contentId, msg.sender);
    }

    /**
     * @dev Distribute revenue for content
     * @param _contentId Content ID
     */
    function distributeRevenue(uint256 _contentId) external payable nonReentrant {
        require(_contentId < _contentIdCounter.current(), "Content does not exist");
        require(msg.value > 0, "No payment received");

        Content storage content = contents[_contentId];
        require(content.isActive, "Content is not active");

        // Calculate splits
        uint256 producerAmount = (msg.value * paymentSplit.producerPercentage) / 10000;
        uint256 platformAmount = msg.value - producerAmount;

        // Update total revenue
        content.totalRevenue += msg.value;

        // Distribute payments
        if (producerAmount > 0) {
            payable(paymentSplit.producer).transfer(producerAmount);
        }
        if (platformAmount > 0) {
            payable(paymentSplit.platform).transfer(platformAmount);
        }

        emit RevenueDistributed(_contentId, paymentSplit.producer, producerAmount, platformAmount);
    }

    /**
     * @dev Get content information
     * @param _contentId Content ID
     */
    function getContent(uint256 _contentId) external view returns (Content memory) {
        require(_contentId < _contentIdCounter.current(), "Content does not exist");
        return contents[_contentId];
    }

    /**
     * @dev Get producer's content
     * @param _producer Producer address
     */
    function getProducerContent(address _producer) external view returns (uint256[] memory) {
        return producerContent[_producer];
    }

    /**
     * @dev Update payment split (only owner)
     * @param _producerPercentage New producer percentage
     * @param _platformPercentage New platform percentage
     */
    function updatePaymentSplit(
        uint256 _producerPercentage,
        uint256 _platformPercentage
    ) external onlyOwner {
        require(_producerPercentage + _platformPercentage == 10000, "Percentages must sum to 100%");

        paymentSplit.producerPercentage = _producerPercentage;
        paymentSplit.platformPercentage = _platformPercentage;

        emit PaymentSplitUpdated(_producerPercentage, _platformPercentage);
    }

    /**
     * @dev Update producer address
     * @param _newProducer New producer address
     */
    function updateProducer(address _newProducer) external onlyOwner {
        require(_newProducer != address(0), "Invalid producer address");
        paymentSplit.producer = _newProducer;
    }

    /**
     * @dev Update platform address
     * @param _newPlatform New platform address
     */
    function updatePlatform(address _newPlatform) external onlyOwner {
        require(_newPlatform != address(0), "Invalid platform address");
        paymentSplit.platform = _newPlatform;
    }

    /**
     * @dev Deactivate content
     * @param _contentId Content ID
     */
    function deactivateContent(uint256 _contentId) external onlyOwner {
        require(_contentId < _contentIdCounter.current(), "Content does not exist");
        contents[_contentId].isActive = false;
    }

    /**
     * @dev Pause contract
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause contract
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Emergency withdraw (only owner)
     */
    function emergencyWithdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");
        payable(owner()).transfer(balance);
    }
}

contracts/QuiFlixNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/interfaces/IERC2981.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title QuiFlixNFT
 * @dev NFT Ticket Contract for QuiFlix films with EIP-2981 royalty support
 */
contract QuiFlixNFT is ERC721, ERC721URIStorage, ERC721Enumerable, Ownable, ReentrancyGuard, IERC2981 {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdCounter;

    // Struct to store film metadata
    struct FilmMetadata {
        string title;
        string description;
        string genre;
        uint256 duration; // in seconds
        uint256 releaseDate;
        address producer;
        string ipfsHash;
        uint256 price; // in wei
        bool isActive;
    }

    // Mapping from token ID to film metadata
    mapping(uint256 => FilmMetadata) public films;

    // Mapping from producer to their films
    mapping(address => uint256[]) public producerFilms;

    // Royalty information
    uint256 public constant ROYALTY_BASIS_POINTS = 250; // 2.5%
    address public royaltyRecipient;

    // Platform fee
    uint256 public constant PLATFORM_FEE_BASIS_POINTS = 100; // 1%
    address public platformFeeRecipient;

    // Events
    event FilmCreated(uint256 indexed tokenId, address indexed producer, string title, uint256 price);
    event FilmApproved(uint256 indexed tokenId, address indexed producer, string title);
    event FilmPurchased(uint256 indexed tokenId, address indexed buyer, uint256 price);
    event FilmResold(uint256 indexed tokenId, address indexed seller, address indexed buyer, uint256 price);
    event RoyaltyPaid(uint256 indexed tokenId, address indexed recipient, uint256 amount);

    constructor(
        address _royaltyRecipient,
        address _platformFeeRecipient
    ) ERC721("QuiFlix Film Ticket", "QFT") {
        royaltyRecipient = _royaltyRecipient;
        platformFeeRecipient = _platformFeeRecipient;
    }

    /**
     * @dev Create a new film NFT (anyone can create, but films start inactive)
     * @param _title Film title
     * @param _description Film description
     * @param _genre Film genre
     * @param _duration Film duration in seconds
     * @param _releaseDate Film release date
     * @param _ipfsHash IPFS hash of the film content
     * @param _price Price in wei
     * @param _tokenURI Metadata URI
     */
    function createFilm(
        string memory _title,
        string memory _description,
        string memory _genre,
        uint256 _duration,
        uint256 _releaseDate,
        string memory _ipfsHash,
        uint256 _price,
        string memory _tokenURI
    ) external returns (uint256) {
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();

        films[tokenId] = FilmMetadata({
            title: _title,
            description: _description,
            genre: _genre,
            duration: _duration,
            releaseDate: _releaseDate,
            producer: msg.sender,
            ipfsHash: _ipfsHash,
            price: _price,
            isActive: false // Start inactive, needs approval
        });

        producerFilms[msg.sender].push(tokenId);

        _safeMint(address(this), tokenId); // Mint to contract initially
        _setTokenURI(tokenId, _tokenURI);

        emit FilmCreated(tokenId, msg.sender, _title, _price);

        return tokenId;
    }

    /**
     * @dev Approve a film for sale
     * @param _tokenId Token ID of the film
     */
    function approveFilm(uint256 _tokenId) external onlyOwner {
        require(_exists(_tokenId), "Film does not exist");
        require(!films[_tokenId].isActive, "Film is already active");

        films[_tokenId].isActive = true;

        emit FilmApproved(_tokenId, films[_tokenId].producer, films[_tokenId].title);
    }

    /**
     * @dev Purchase a film NFT
     * @param _tokenId Token ID of the film
     */
    function purchaseFilm(uint256 _tokenId) external payable nonReentrant {
        require(_exists(_tokenId), "Film does not exist");
        require(films[_tokenId].isActive, "Film is not active");
        require(ownerOf(_tokenId) == address(this), "Film not available for purchase");
        require(msg.value >= films[_tokenId].price, "Insufficient payment");

        address producer = films[_tokenId].producer;
        uint256 price = films[_tokenId].price;

        // Calculate fees
        uint256 platformFee = (price * PLATFORM_FEE_BASIS_POINTS) / 10000;
        uint256 royaltyAmount = (price * ROYALTY_BASIS_POINTS) / 10000;
        uint256 producerPayment = price - platformFee - royaltyAmount;

        // Transfer NFT to buyer
        _transfer(address(this), msg.sender, _tokenId);

        // Distribute payments
        if (platformFee > 0) {
            payable(platformFeeRecipient).transfer(platformFee);
        }
        if (royaltyAmount > 0) {
            payable(royaltyRecipient).transfer(royaltyAmount);
        }
        if (producerPayment > 0) {
            payable(producer).transfer(producerPayment);
        }

        // Refund excess payment
        if (msg.value > price) {
            payable(msg.sender).transfer(msg.value - price);
        }

        emit FilmPurchased(_tokenId, msg.sender, price);
    }

    /**
     * @dev Transfer NFT with royalty payment (for secondary sales)
     * @param _tokenId Token ID
     * @param _to Recipient address
     * @param _price Sale price
     */
    function transferWithRoyalty(uint256 _tokenId, address _to, uint256 _price) external payable nonReentrant {
        require(_exists(_tokenId), "Film does not exist");
        require(ownerOf(_tokenId) == msg.sender, "Not the owner");
        require(msg.value >= _price, "Insufficient payment");

        address producer = films[_tokenId].producer;

        // Calculate royalty
        uint256 royaltyAmount = (_price * ROYALTY_BASIS_POINTS) / 10000;
        uint256 sellerPayment = _price - royaltyAmount;

        // Transfer NFT
        _transfer(msg.sender, _to, _tokenId);

        // Pay royalty to producer
        if (royaltyAmount > 0) {
            payable(producer).transfer(royaltyAmount);
            emit RoyaltyPaid(_tokenId, producer, royaltyAmount);
        }

        // Pay seller
        if (sellerPayment > 0) {
            payable(msg.sender).transfer(sellerPayment);
        }

        // Refund excess
        if (msg.value > _price) {
            payable(msg.sender).transfer(msg.value - _price);
        }

        emit FilmResold(_tokenId, msg.sender, _to, _price);
    }

    /**
     * @dev Resell a film NFT
     * @param _tokenId Token ID of the film
     * @param _newPrice New price for the film
     */
    function resellFilm(uint256 _tokenId, uint256 _newPrice) external {
        require(_exists(_tokenId), "Film does not exist");
        require(ownerOf(_tokenId) == msg.sender, "Not the owner");
        require(_newPrice > 0, "Price must be greater than 0");

        films[_tokenId].price = _newPrice;

        emit FilmResold(_tokenId, msg.sender, address(0), _newPrice);
    }

    /**
     * @dev Get film metadata
     * @param _tokenId Token ID
     */
    function getFilmMetadata(uint256 _tokenId) external view returns (FilmMetadata memory) {
        require(_exists(_tokenId), "Film does not exist");
        return films[_tokenId];
    }

    /**
     * @dev Get films by producer
     * @param _producer Producer address
     */
    function getProducerFilms(address _producer) external view returns (uint256[] memory) {
        return producerFilms[_producer];
    }

    /**
     * @dev EIP-2981 royalty info
     */
    function royaltyInfo(uint256 _tokenId, uint256 _salePrice) external view override returns (address, uint256) {
        require(_exists(_tokenId), "Token does not exist");
        uint256 royaltyAmount = (_salePrice * ROYALTY_BASIS_POINTS) / 10000;
        return (royaltyRecipient, royaltyAmount);
    }

    /**
     * @dev Update royalty recipient
     */
    function updateRoyaltyRecipient(address _newRecipient) external onlyOwner {
        require(_newRecipient != address(0), "Invalid address");
        royaltyRecipient = _newRecipient;
    }

    /**
     * @dev Update platform fee recipient
     */
    function updatePlatformFeeRecipient(address _newRecipient) external onlyOwner {
        require(_newRecipient != address(0), "Invalid address");
        platformFeeRecipient = _newRecipient;
    }

    /**
     * @dev Deactivate a film
     */
    function deactivateFilm(uint256 _tokenId) external onlyOwner {
        require(_exists(_tokenId), "Film does not exist");
        films[_tokenId].isActive = false;
    }

